import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import {HeaderPag, FooterPag, NavMenu} from "../layout/index";
import Navegacion from './navegacion';
import Views from '../views';

const Home = Views.Home();

function RoutesPag(){
    return(
        <BrowserRouter>
            <Routes>
                <Route path="/" element={Home}/>
            </Routes>
        </BrowserRouter>
    );
};

export default function Pagina(){
    return(
        <React.StrictMode>
            <HeaderPag/>
            <main>
                <NavMenu temas={Navegacion.map(n => n)}/>
                <RoutesPag/>
            </main>
            <FooterPag/>

        </React.StrictMode>
    )

}
